import React from 'react';
import ProfileCard from '../components/organisms/ProfileCard';

const user = {
  name: 'John Doe',
  age: 25,
  weight: 75,
  goal: 'muscle_gain',
  avatarSrc: undefined,
};

export default function Profile() {
  return (
    <div style={{ padding: 32, background: '#f5f5f5', minHeight: '100vh' }}>
      <ProfileCard user={user} />
    </div>
  );
}
